export default function Card({ characters }) {
  return (
    <div>
      {characters.map((character) => (
        <div class="card" key={characters.id} style={{ width: "18rem" }}>
          <img src={character.image} class="card-img-top" alt="..." />
          <div class="card-body">
            <h5 class="card-title">{character.name}</h5>
            <p class="card-text">
              {character.species} <br />
              {character.location.name} <br />
            </p>
            <a href="http://www.google.com" class="btn btn-primary">
              Go somewhere
            </a>
          </div>
        </div>
      ))}
    </div>
  );
}
